import "./About.css";
import Pharagrap from "../pharagrap/Pharagrap";
import aboutImage from "../../../assets/aboutImg.png"
import { useState } from "react";

function About(){
  
  const [imageIndex, setImageIndex] = useState<number>(0);


  
  
  
  
  return(
    <div className="about-cont">
      <div className="about-carusel">
        <img src={aboutImage} 
        style={{transform: `translateX(${imageIndex * 100}%)`}}
        alt="img2"
        />
        <img src={aboutImage} 
        style={{transform: `translateX(${imageIndex * 100}%)`}}
        alt="img2"
        />
        <img src={aboutImage} 
        style={{transform: `translateX(${imageIndex * 100}%)`}}
        alt="img2"
        />

        <div 
        onClick={() => setImageIndex(-1)}
        style={{border: '1px solid red'}}
        className="index-div"></div
        >
        <div 
        onClick={() => setImageIndex(0)}
        className="index-div"></div
        >
        <div 
        onClick={() => setImageIndex(-2)}
        className="index-div"></div
        >
      </div>
      
      <div className="more-about">
        <div className="title-year">
          <h1>Kamachatka Solitude</h1>
          <h3>2019</h3>
        </div>
        <div className="phr">

          <Pharagrap 
          title="Photography"
          desc="Lorem ipsum dolor sit amet consectetur adipisicing elit. Illo, blanditiis repellat provident praesentium sunt porro, reiciendis inventore " />
          
          <Pharagrap 
          title="Year"
          desc="2019" />
          
          <Pharagrap 
          title="Narrative"
          desc="Lorem ipsum  elit. Illo, blanditiis repellat provident praesentium sunt porro, reiciendis inventore " />
          
          <button>Explore Photo</button>
        </div>
      </div>
      
    </div>
  );
}

export default About
